import {
  TEST_ADD_ACTION,
  TEST_SUBTRACT_ACTION
} from '../types';

export const addToCounter = () => {
  return {
    type: TEST_ADD_ACTION,
  };
};

export const subtractFromCounter = () => {
  return {
    type: TEST_SUBTRACT_ACTION,
  };
};
